import React from 'react';

let TodoList = ({ todoList, todoDeleteHandler }) =>
    <table>
        <tbody>
            {todoList.map(todo =>
                <tr>
                    <td onClick={this.crossTodo}>{todo.text}</td>
                    <td><button onClick={() => todoDeleteHandler(todo.id)}>-</button></td>
                </tr>
            )}
        </tbody>
    </table>

export default TodoList;
